import 'dart:convert';
import 'package:flutter/material.dart';
import 'color_lens_page.dart';
import 'setting_page.dart';
import 'package:url_launcher/url_launcher.dart';

class AboutPage extends StatefulWidget {
  @override
  _AboutPageState createState() => _AboutPageState();
}

class _AboutPageState extends State<AboutPage> {

  void lanchUrl(String url) async {
    if (await canLaunch(url)) {
      await launch(url, forceWebView: true);
    } else {
      throw 'Could not launch $url';
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('关于'),
        actions: <Widget>[
          IconButton(
            icon: Icon(Icons.color_lens),
            onPressed: () => Navigator.of(context)
                .push(MaterialPageRoute(builder: (context) => ColorLensPage())),
          ),
          IconButton(
            icon: Icon(Icons.settings),
            onPressed: () => Navigator.of(context)
                .push(MaterialPageRoute(builder: (context) => SettingPage())),
          )
        ],
      ),
      body: ListView(
        children: <Widget>[
          InkWell(
            child: Container(
              color: Theme.of(context).primaryColor,
              height: 260.0,
              child: Center(
                child: ListTile(
                  title: Text(
                    'ESO',
                    textAlign: TextAlign.center,
                    style: TextStyle(
                      fontSize: 120.0,
                      color: Theme.of(context).primaryTextTheme.title.color,
                      fontStyle: FontStyle.italic,
                    ),
                  ),
                  subtitle: Text(
                    'version 1.0.0',
                    textAlign: TextAlign.center,
                    style: TextStyle(
                      fontSize: 22.0,
                      height: 1.6,
                      color: Theme.of(context).primaryTextTheme.title.color,
                    ),
                  ),
                ),
              ),
            ),
            onTap: () => showAboutDialog(
              context: context,
              applicationVersion: '1.0.0',
              children: <Widget>[
                Divider(),
                Container(
                  height: 320,
                  width: 320,
                  child: Image.memory(
                    base64Decode(
                        ''),
                  ),
                ),
                Text(
                  '捐赠[支付宝]',
                  textAlign: TextAlign.center,
                ),
                Divider(),
              ],
            ),
          ),
          Card(
            child: ListTile(
              title: Text('开源地址'),
              subtitle: Text('https://github.com/mabDc/lizi'),
              onTap: () => lanchUrl('https://github.com/mabDc/lizi'),
            ),
          ),
          Card(
            child: ListTile(
              title: Text('问题反馈'),
              subtitle: Text('https://github.com/mabDc/lizi/issues'),
              onTap: () => lanchUrl('https://github.com/mabDc/lizi/issues'),
            ),
          ),
          Card(
            child: ListTile(
              title: Text('规则说明'),
              subtitle: Text('https://github.com/mabDc/lizi/blob/master/rule.md'),
              onTap: () => lanchUrl('https://github.com/mabDc/lizi/blob/master/rule.md'),
            ),
          ),
        ],
      ),
    );
  }
}
